import React from "react";
import Weather from "./components/weather";
import Hotels from "./components/hotels";
import Places from "./components/places";
import "./styles/App.css";

function App() {
  return (
    <div className="App">
      <header>
        <h1>Travel Insights</h1>
      </header>
      <main>
        <Weather />
        <Hotels />
        <Places />
      </main>
    </div>
  );
}

export default App;
